def cocktail_sort(arr):
    swapped = True
    start = 0
    end = len(arr) - 1
    while swapped == True:

        swapped = False

        for i in range(start, end):
            if arr[i] > arr[i + 1]:
                arr[i], arr[i+1] = arr[i + 1], arr[i]
                swapped = True
        
        if swapped == False:
            break
        
        swapped = False

        end = end - 1

        for i in range(end - 1, start - 1, -1):
            if arr[i] > arr[i + 1]:
                arr[i] , arr[i + 1] = arr[i + 1], arr[i]
                swapped = True
        
        start = start + 1



